import React from 'react';
import FooterContactInfo from './FooterContactInfo';
import FooterNavigation from './FooterNavigation';
import FooterCopyright from './FooterCopyright';

const FooterLayout = () => {
  return (
    <div className="d-flex flex-column" style={{ width: '100%', backgroundColor: '#051c34',  expand:"lg",
      fixed:"bottom", boxShadow: "0px -3px 20px rgb(103, 97, 224)"
     }}>
      <div className="d-flex flex-wrap justify-content-between align-items-start" style={{ flexGrow: 1, padding: '40px 60px' }}>
        <FooterContactInfo />
        <FooterNavigation />
      </div>
      <FooterCopyright />
    </div>
  );
};

export default FooterLayout;
